altairApp.filter("multiSelectFilter",function(){return function(n,t){var f,e,i;if(t==undefined)return n;var r=Object.keys(t),o=[],u=!0;for(f=0;f<n.length;f++){for(e=n[f],u=!0,i=0;i<r.length;i++)if(t[r[i]]!=undefined)if(t[r[i]].length==0||t[r[i]].contains(e[r[i]]))u=!0;else{u=!1;break}u&&o.push(e)}return o}}).filter("jsonDate",function(){return function(n){return n?new Date(n):null}}).filter("momentDate",function(){return function(n,t,i){return n?t?moment(n,t).format(i):moment(new Date(n)).format(i):null}}).filter("initials",function(){return function(n){return n?n.split(" ").map(function(n){return n.charAt(0)}).join(""):null}}).filter("reverseOrder",function(){return function(n){return n.slice().reverse()}}).filter("trust",["$sce",function(n){return function(t){return n.trustAsHtml(t)}}]);